void Set_Screen_Rotation(uint8_t rotation)
{
	init_cmds1[55] = rotation;
	ST7735_Init();
}

void Screen_Opening(void)
{
	static uint8_t state = 0;
	static uint8_t logo_printed = 0;
	if(logo_printed == 0)
	{
		Set_Screen_Rotation(VERTICAL);
		ST7735_DrawImage(0, 0, 128, 160, (uint16_t*)mgm_logo_2);
		logo_printed = 1;
	}

	if(init_cmds1[55] != HORIZONTAL)
	{
		Set_Screen_Rotation(HORIZONTAL);
	}

	switch (state)
	{
		case 0:
		{
			char yazi_3[] = "Loading .  ";
			ST7735_WriteString(25, 70, yazi_3, Font_11x18, ST7735_WHITE, ST7735_BLACK);
			state = 1;
			break;
		}

		case 1:
		{
			char yazi_2[] = "Loading .. ";
			ST7735_WriteString(25, 70, yazi_2, Font_11x18, ST7735_WHITE, ST7735_BLACK);
			state = 2;
			break;
		}

		case 2:
		{
			char yazi[] = "Loading ...";
			ST7735_WriteString(25, 70, yazi, Font_11x18, ST7735_WHITE, ST7735_BLACK);
			state = 0;
			break;
		}
		default: break;
	}
}


void Screen_Idle_Page(uint8_t sq, uint8_t internet_connection)
{
	page = Idle_Page;
	ST7735_FillScreen(ST7735_BLACK);
	ST7735_WriteString(40, 15, "Magma", Font_11x18, ST7735_WHITE, ST7735_BLACK);
	ST7735_WriteString(30, 45, "Telemetry", Font_11x18, ST7735_WHITE, ST7735_BLACK);
	ST7735_WriteString(30, 75, "Device ID : 2", Font_7x10, ST7735_WHITE, ST7735_BLACK);
	if(internet_connection == 1)
	{
		ST7735_WriteString(25, 110, "Connection: OK", Font_7x10, ST7735_WHITE, ST7735_BLACK);
	}

	else
	{
		//ST7735_WriteString(5, 90, "Device Resetting in 10.               ", Font_7x10, ST7735_WHITE, ST7735_BLACK);
		ST7735_WriteString(25, 110, "Connection: NOT OK!                   ", Font_7x10, ST7735_WHITE, ST7735_BLACK);
	}

	if(internet_connection == TRUE)
	{
		Screen_Signal_Quality(135, 10, ST7735_GREEN, sq);
	}

	else
	{
		Screen_Signal_Quality(135, 10, ST7735_RED, sq);
	}

}

void Screen_Show_Error_Message(char* error_code)
{
	Set_Screen_Rotation(VERTICAL);
	ST7735_DrawImage(0, 0, 128, 160, (uint16_t*)err_logo_2);

	Set_Screen_Rotation(HORIZONTAL);
	ST7735_WriteString(28, 95, "Error Code 0x69", Font_7x10, ST7735_WHITE, ST7735_BLACK);
	ST7735_WriteString(28, 110, "Call The Service", Font_7x10, ST7735_WHITE, ST7735_BLACK);
}

void Screen_Sale_UI(void)
{
	  if(init_cmds1[55] != HORIZONTAL)
	  {
		  Set_Screen_Rotation(HORIZONTAL);
	  }
	  ST7735_FillScreen(ST7735_BLACK);
	  char text[100] = "PRICE : ";
	  char tl[10];
	  float tl_f32 = (mdb_data.product_price_u16 / 100.0f);
	  ftoa(tl_f32, tl , 2);
	  strcat(text, tl);
	  //vars_to_str(text, "Urun Fiyati : %f", 0.5);
	  ST7735_WriteString(10, 20, text, Font_11x18, ST7735_WHITE, ST7735_BLACK);
	  vars_to_str(text, "SPR NO : %d", mdb_data.product_num_16);
	  ST7735_WriteString(10, 40, text, Font_11x18, ST7735_WHITE, ST7735_BLACK);
}

void Screen_NFC_Sale_UI(void)
{
	if(init_cmds1[55] != HORIZONTAL)
	{
		Set_Screen_Rotation(HORIZONTAL);
	}

	ST7735_FillScreen(ST7735_BLACK);
	page = NFC_Post_Page;
	char text[100];
	//vars_to_str(text, "Urun Fiyati : %f", 0.5);
	if(end_point_data.card_status != TRUE)
	{
		ST7735_WriteString(10, 20, "Card UID Not Found.", Font_7x10, ST7735_WHITE, ST7735_BLACK);
	}

	else
	{
		vars_to_str(text, "UID : %u%u%u%u%u%u", 1, 2, 3, 4, 5, 6);
		ST7735_WriteString(10, 20, text, Font_7x10, ST7735_WHITE, ST7735_BLACK);
		vars_to_str(text, "Credit : %.2f", end_point_data.card_credit_f32);
		ST7735_WriteString(10, 40, text, Font_7x10, ST7735_WHITE, ST7735_BLACK);
	}
}

